import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import App from './App';
import * as serviceWorker from './serviceWorker';

var dom =  React.createElement('div',{className:'mydiv'},'<span>hello world</span>');
var dom2 = React.createElement('div',{className:'mydiv'},dom);
//ReactDOM.render(dom,document.getElementById('root'),()=>{alert('加载完成')});
ReactDOM.render(dom2,document.getElementById('root'),()=>{alert('加载完成')});
//ReactDOM.render(<App />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
